import Layout from '../comps/Layout';

export default function Recipes(){
    return(
        <Layout>
            <h1>Recipes:</h1>
            <p>Below will list potential recipes in card format</p>
            <a href="https://dribbble.com/shots/6514391--Exploration-Recipe-App">Design options 1</a>
            <a href="https://dribbble.com/shots/5628630-Fall-Favorites-Animation-Breakdown">Design option 2</a>
        </Layout>
    )
}
